        $.ajax({
            url: 'index.php?route=account/wishlist/add',
            type: 'post',
            data: 'product_id=' + product_id,
            dataType: 'json',
            success: function(json) {
                if(json.count > 0){
                    document.getElementById('wishlist-nav').classList.add('active')
                    document.getElementById('mobile-wishlist-nav').classList.add('active')
                }else{
                    document.getElementById('wishlist-nav').classList.remove('active')
                    document.getElementById('mobile-wishlist-nav').classList.remove('active')
                }
            },
            error: function(xhr, ajaxOptions, thrownError) {
                console.log(thrownError + "\r\n" + xhr.statusText + "\r\n" + xhr.responseText);
            }
        });
